class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        finalans=set()
        n=len(nums)
        #print(n)
        for i in range(n-2):
            x=nums[i]
            if (i!=0 and x!=nums[i-1]) or i==0:
                """
                    for j in range(m-1):
                        for k in range(j+1,m):
                            if (checkarr[k]+x/2)==-(checkarr[j]+x/2):
                                l=[x,checkarr[j],checkarr[k]]
                                l.sort()
                                finalans.add(tuple(l))
                            else:
                                break
                """
                required={}
                for y in range(i+1,n):
                    if -x-nums[y] in required:
                        l=[x,nums[y],-x-nums[y]]
                        l.sort()
                        finalans.add(tuple(l))
                    else:
                        required[nums[y]]=0
       
        finalans=list(finalans)
        for i in range(len(finalans)):
            finalans[i]=list(finalans[i])
            
        return finalans
        
obj=Solution()
print(obj.threeSum([-1,0,1,2,-1,-4]))
        
